import React, { useState, useEffect } from 'react';
import { color, font, greenGradient, greenBackground } from '../../layout/main';
import uuid from 'uuid/v1';
import Title from './title';

const Gallery = () => {

  return(
    <div className="main">
      <div className="cont shadow">

      </div>
      <style jsx>{`
        .main{
          height: 100%;
          display: flex,
          justify-content: center;
          align-item: center;
          border: 1px solid red;
        }
        .cont{
          width: 80%;
          height: 90%;
          background: ${color.prim};
        }
      `}
      </style>
    </div>
  )
}

const Main = ()=> {

  return(
    <div className="main">
      <Title word="top greenpost's" />
      <Gallery />
      <style jsx>{`
        .main{
          ${greenBackground()}
          height: 100vh;
        }
      `}
      </style>
    </div>
  )
}


export default Main;
